import React from 'react';

function MenuItem ({ title, subTitle }) {

    return (
        <div className='menu-item'>
            <div className="content">

                <h1 className="title">
                    {title}
                </h1>

                <span className="subtitle">
                    {subTitle ? subTitle : 'Shop Now'}
                </span>  

            </div>
        </div>
    );
};
